rs[msg.sender]; // assigns reference\n        if (sender.voted) return;\n        while (voters[to].delegate != address(0) && voters[to].delegate != msg.sender)\n            to = voters[to].delegate;\n        if (to == msg.sender) return;\n        sender.voted = true;\n        sender.delegate = to;\n        Voter delegate = voters[to];\n        if (delegate.voted)\n            proposals[delegate.vote].voteCount += sender.weight;\n        else\n            delegate.weight += sender.weight;\n    }\n\n    /// Give a single vote to proposal $(proposal).\n    function vote(uint8 proposal) {\n        Voter sender = voters[msg.sender];\n        if (sender.voted || proposal >= proposals.length) return;\n        sender.voted = true;\n        sender.vote = proposal;\n        proposals[proposal].voteCount += sender.weight;\n    }\n\n    function winningProposal() constant returns (uint8 winningProposal) {\n        uint256 winningVoteCount = 0;\n        for (uint8 proposal = 0; proposal < proposals.length; proposal++)\n            if (proposals[proposal].voteCount > winningVoteCount) {\n                winningVoteCount = proposals[proposal].voteCount;\n                winningProposal = proposal;\n            }\n    }\n}","browser/test/client/credit.sol":"","browser/src/voting.sol":"","browser/src/leasing.sol":"","browser/src/gmbh/contract.sol":false,"browser/src/gmbh/test.sol":false,"browser/src/gmbh/company.sol":false,"browser/src/gmbh/node_modules/ballot.sol":false,"browser/src/ug/finance.sol":false,"browser/app/solidity/mode.sol":true,"browser/app/ethereum/constitution.sol":true}},"optimization":1,"missingInputs":[],"result":{"contracts":{},"errors":["browser/app/ethereum/constitution.sol:1:1: ParserError: Expected import directive or contract definition.\ntrue\n^\n","browser/app/solidity/mode.sol:1:1: ParserError: Expected import directive or contract definition.\ntrue\n^\n","browser/src/gmbh/company.sol:1:1: ParserError: Expected import directive or contract definition.\nfa